import './App.css';
import Header from './components/Menu';
import Title from './components/Titulo';
import Filme from './components/Filme';
import Footer from './components/Footer';

function App() {
  return (
    <Router>
      <div className="App">
        <ul>
          <li><Link to='/'>Home</Link></li>
          <li><Link to='/planos'>Planos</Link></li>
          <li>Sobre</li>
        </ul>
      </div>
    </Router>

  );
}

export default App;
